import React from 'react';
import { Link } from 'react-router-dom';

const Login = () => {
  return <div className='col text-center'>
      <h1> Hola Bienvenides </h1>
      <small > Inicia sesión para comenzar con los pedidos </small>


  <form>
     <div className="form-group">
      <input type="email" id="mailRegister" className="form-control mt-3"  placeholder="correo@ejemplo.com" pattern="^\\S+@\\S+\\.\\S+$" required/>
      </div>
    <div className="form-group">

      <input type="password" id="passwordRegister" className="form-control mt-3"  placeholder="contraseña" />
     </div>


     </form>
      <Link to = {`/time`} > <button type="button" className="btn btn-outline-success"> Comenzar </button> </Link>
     No tienes cuenta aún <Link to = {`/register`} > <button type="button" className="btn btn-outline-warning"> Registrate </button> </Link>

  </div>;
};

export default Login;
